import React from "react";


const Swapi = ({hero, starships}) => {

    function ships (starships) {
        return starships.map((starship) => <li>{starship}</li>)
    }
  return <div>
      <p>{hero}</p>
      <br />
      <ol>{ships(starships)}</ol>
    </div>;
};

export default Swapi;
